import { SportsEsports } from "@mui/icons-material";
import Grid2 from "@mui/material/Unstable_Grid2/Grid2";
import React from "react";

const Products=(props)=>{
    return (
        <Grid2 container spacing={2}>
        <Grid2 xs={8}>
          <Item>xs=8</Item>
        </Grid2>
        <Grid2 xs={4}>
          <Item>xs=4</Item>
        </Grid2>
        <Grid2 xs={4}>
          <Item>xs=4</Item>
        </Grid2>
        <Grid2 xs={8}>
          <Item>xs=8</Item>
        </Grid2>
      </Grid2>
    )
}

export default Products
